import React, { useEffect } from "react"

const ListOfTopics = () => {

    const [data, setData] = useState([]);

    const getList = async () => {
        e.preventDefault();
        try {
            const response = await fetch("http://localhost:4000/todos");
            const jsonData = await response.json();
            window.location = "/";
        } catch (error) {
            console.error(error);
        }
    }

    useEffect(() => {getList()}, []);

    return (<form>
        <table>
            <thead>
                <tr>
                    <th>
                        Account
                    </th>
                    <th>
                        Password
                    </th>
                </tr>
            </thead>
            <tbody>
                {data.map(data => (
                    <tr>
                        <td>{data.account_name}</td>
                        <td>{data.account_password}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    </form>);
};

export default ListOfTopics;
